export default class Video {
  thumbnailURI: string;
  title: string;
  artist: string;
  views: number;
  publishDate: Date;
  videoURI: string;

  constructor(
    thumbnailURI: string,
    title: string,
    artist: string,
    views: number,
    publishDate: Date,
    videoURI: string
  ) {
    this.thumbnailURI = thumbnailURI;
    this.title = title;
    this.artist = artist;
    this.views = views;
    this.publishDate = publishDate;
    this.videoURI = videoURI;
  }

  // helper method for debugging
  print() {
    console.log(
      "title:",
      this.title,
      "artist: ",
      this.artist,
      "thumbnail URI: ",
      this.thumbnailURI,
      "views:",
      this.views,
      "date uploaded:",
      this.publishDate,
      "video URI",
      this.videoURI
    );
  }

  // converts the date the video was published into its natural language equivalent
}
